CREATE TABLE admin(

	nome VARCHAR(100), 
	sobrenome VARCHAR(100), 
	login VARCHAR(20) NOT NULL, 
	senha VARCHAR(100) NOT NULL,
	PRIMARY KEY (login),
	UNIQUE KEY (login)
);

