CREATE TABLE cliente(
	cpf VARCHAR(14) NOT NULL,
	nomeCompleto VARCHAR(200) NOT NULL,
	rg VARCHAR(13),
	cep VARCHAR(9), 
	rua VARCHAR(200), 
	numero VARCHAR(10),
	bairro VARCHAR(100), 
	cidade VARCHAR (100),
	estado VARCHAR (100), 
	telefone VARCHAR(15),
	email VARCHAR(100),
	PRIMARY KEY(cpf),
	UNIQUE KEY(rg)
);

ALTER TABLE cliente ADD COLUMN fornecedor BOOLEAN DEFAULT FALSE;

